import React from "react";

function TableEx(){
    return(
        <>
            <>
            <tr key={index}>
         <td>{index+1}</td>
          <td>{element.name}</td>
          <td>{element.email}</td>
          <td>{element.contact}</td>
          <td></td>
          </tr>
            </>
        </>
    )
}

export default TableEx;
